import styled from 'styled-components';

export const NavWrapper = styled.nav `
    background: var(--mainPurple);
    .nav-item .nav-link {
        font-weight: lighter;
        color: var(--mainSnow);
        transition: all 0.4s ease-in-out;
    } 
    
    .text-black {
        color: var(--mainDarker);
        text-decoration: none;
    }

    .cart {
        position: relative;
        left: 15px;
    }

    .count {
        position: relative;
        top: -18px;
        left: -5px;
        font-size: 18px;
        font-weight: bold;
        color: var(--mainGreen);
    }
   
`
